import React from 'react'
import { Link } from 'react-router-dom'
import { ReactComponent as HomeIcon } from '../assets/home.svg'

const HomeButton = () => {
    return (
        <Link to="/viking" className="floating-button">
            <HomeIcon />
        </Link>
    )
}

export default HomeButton
